import { registerThemeProperties } from "@ui5/webcomponents-base/dist/asset-registries/Themes.js";

import defaultThemeBase from "@ui5/webcomponents-theme-base/dist/generated/themes/sap_fiori_3/parameters-bundle.css.js";
import defaultTheme from "./sap_fiori_3/parameters-bundle.css.js";

registerThemeProperties("@ui5/webcomponents-theme-base", "sap_fiori_3", defaultThemeBase);
registerThemeProperties("@ui5/webcomponents", "sap_fiori_3", defaultTheme);
export default ":host(:not([hidden])){display:inline-block}:host{color:var(--sapField_TextColor);background-color:var(--sapField_Background)}:host .ui5-duration-picker-input{width:100%;color:inherit;background-color:inherit}.ui5-duration-picker-input-icon-button:hover{cursor:pointer;background:var(--sapButton_Hover_Background)}.ui5-duration-picker-input-icon-button:active{background-color:var(--sapButton_Active_Background);color:var(--sapButton_Active_TextColor)}.ui5-duration-picker-input-icon-button[pressed]{background-color:var(--sapButton_Active_Background);color:var(--sapButton_Active_TextColor)}";
